%script 

BEGIN
     EXECUTE IMMEDIATE 'DROP TABLE TXN_TBL';
     EXCEPTION WHEN OTHERS THEN NULL;
END;
/

CREATE TABLE TXN_TBL( ID NUMBER, 
                      NAME VARCHAR2(32),
                      VALUE NUMBER
                    );

