%script

BEGIN DBMS_DATA_MINING.DROP_MODEL('GLM_CLAS_USING_NESTED_COLUMN');
EXCEPTION WHEN OTHERS THEN NULL; END;
/

DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;

BEGIN

    v_setlst(dbms_data_mining.algo_name) := dbms_data_mining.algo_generalized_linear_model;
    v_setlst(dbms_data_mining.prep_auto) :=  dbms_data_mining.prep_auto_on;


    DBMS_DATA_MINING.CREATE_MODEL2(
        model_name          => 'GLM_CLAS_USING_NESTED_COLUMN',
        mining_function     => dbms_data_mining.classification,
        data_query          => 'select * from TXN_NESTED_COL_NUM',
        set_list            => v_setlst,
        case_id_column_name => 'ID',
        target_column_name  => 'CLASS');
END;
/
